        "Desc": "砂漠に散らばる多くの遺跡構造体を取りまとめている永久不変の機械。中には、孤独な君王の執念が留まっているようだ。\n夢の中の友人による教戒のためか、あるいは天上の諸聖が有する権能を手にしようと考えてのことか…王は地上に属すべきでない謎の機械たちを創り出し、これらをもって砂原の上に都市を拓いた。\n千柱の都の廃墟にある古の晶石は、黄金の楽園の美しさを映し続ける——例え王の夢を誰一人、覚えていなくとも。",
