        "Desc": "初期に設計·製造された新式クロックワーク·マシナリーの一つ。\n「奇械公」ことギヨタンは自然哲学学院にいた時期、知的思考をシミュレートするオートマタを実際に作ったという。\n彼がこの説を公式に認めたことはないが、この伝説はその後も数多くのエンジニアの意欲をかき立てている。数十年前に基礎的な思考能力を持ち、人間の感情を読み取れるオートマタを作ったと発表した人がいたが、最終的に関連する成果は認められなかった。",
