        "Name": "殲滅特化型マシナリー·ウーシア",
        "Title": [
            "バイロン伯爵夫人式マシナリー"
        ],
        "Desc": "フォンテーヌ運動エネルギー工学科学研究院はクロックワーク研究と設計において最も主要な機関であるにも拘わらず、民間には科学院に所属していないエンジニアや独立系工房も多い。\nこの機械は当初、独立系エンジニアが恋人とスポンサーを記念して設計·製造したものである。最終的に都市の安全保障あるいは公共の武力機関の武器の一つとして、執律庭に採用された。",
