        "Desc": "対消滅で生じるエネルギーを発射できる装置。厳密には、フォンテーヌ科学院が設立される前に、自然哲学学院の関連研究で生まれた試験装置である。\nそのため、警戒·防御設備としてかなりの商業的成功を収めたにも拘わらず、ほとんどのエンジニアはこれを厳密な意味でのクロックワーク·マシナリーと見なしていない。",
