        "Desc": "建築工事や発掘調査に計り知れない価値を持つ大型クロックワーク·マシナリー。その名はクレメンタイン線を建設する際にカーレスが雇ったエンジニアに由来する。\nこのエンジニアはカーレスの資金援助を受け、ポワソントンネルを貫通させた伝説的な巨大重機「黄金楽団船」を建造した。完成後にこれと似た構造で、サイズを縮小したクロックワーク·マシナリーを設計した。",
