        "Desc": "砂漠より訪れし、まとまりのない傭兵集団の一員。報酬さえ貰えれば、どんな人物の下でも働く。\n古代、この重装戦士は烈日の君王が最も信頼する護衛であった。そのためか、彼らは今でも太陽のような金色の輝きを放つ。\n使用する武器には不吉な悪霊が宿っており、危機的状況に陥った時にその悪霊が目覚める。敗者の慟哭だけが、その怒りを鎮められるが——その敗者が武器の主であるか、敵であるかは、全く関係ない。",
