        "Desc": "砂漠より訪れし、まとまりのない傭兵集団の一員。報酬さえ貰えれば、どんな人物の下でも働く。\nクロスボウが広く普及したため、現在エルマイト部族は最も手練れの戦士しか長弓を使って戦わない。彼女たちは両目になどは頼らず、ただ風砂の流れる音で敵の在り処を感じ取る。\n使用する武器には不吉な悪霊が宿っており、危機的状況に陥った時にその悪霊が目覚める。敗者の慟哭だけが、その怒りを鎮められるが——その敗者が武器の主であるか、敵であるかは、全く関係ない。",
