        "Desc": "砂漠より訪れし、まとまりのない傭兵集団の一員。報酬さえ貰えれば、どんな人物の下でも働く。\n砂の民には音楽と舞踏の伝統がある。最初は神への礼賛。それから王の歓心を買うための演武と戦闘の技術となった。砂漠の伝説によると、寝所や高い塔で王を暗殺した舞姫がいた。彼らの神と王都が流砂に沈んだ今でも、踊り子の記憶は変わらず民族の血筋に刻まれている。\n使用する武器には不吉な悪霊が宿っており、危機的状況に陥った時にその悪霊が目覚める。敗者の慟哭だけが、その怒りを鎮められるが——その敗者が武器の主であるか、敵であるかは、全く関係ない。",
