        "Name": "鉄甲熔炎帝王",
        "Title": [
            "山岳の下で鼓動する熱潮"
        ],
        "Desc": "原海アベラントの頂点に君臨する二大覇者のうちの一種。昔から船乗りの間で語り継がれてきた。\n天敵に遭うことなく、ずっと狩りや食事を続けられる重甲ヤドカニは、成長と共に絶えず自分に適した巻貝や貝殻を探し、新しい鎧とする。しかし最後には大きくなりすぎてしまう。第一次大水期より前に、巨大な重甲ヤドカニが船を襲い、最終的に休職中の海軍司令官バザル·エルトンに撃退されたという記録がある。\nつい、こんな世界を想像してしまう——テイワットのあらゆる人を排除し、際限なく成長する鉄甲熔炎帝王。かの者はついに、この上なく華美な白い鎧「パレ·メルモニア」を身にまとう。もちろん、そんな世界ではふざけて「鉄甲熔炎帝王」などと呼ぶ人はもういないだろうが…",
