        "Desc": "ファデュイの執行官第十一位、「公子」タルタリヤ。\n不吉な「邪眼」から力を吸い取り、暗闇の地で習得した武術で戦う。\n\n無限の戦闘欲を持つ純粋な戦士。\n血まみれの争い、生と死の挑戦は、彼にとって喜びの試練に過ぎない。\n若い「公子」の戦績は広く知られている。\nだが、彼自身にとってはどうでもいい話だ。\n\n何故なら…\n<i>「お前の運命は争いの嵐の目となる。」</i>\n<i>「兵刃を交える音は、常にお前の旋律。」</i>\n<i>「暗闇の記憶に足を踏み入れ、」</i>\n<i>「世界を破壊する力を手に入れるがいい。」</i>。",
