        "_id": 90602,
        "Name": "禍津御建鳴神命",
        "Title": [
            "雷電の稲妻殿"
        ],
        "Desc": "雷電将軍の権能を代行する人形。「永遠」を脅かす敵と対抗するための姿である。\n「永遠」を遂行する雷電影の協力者として、彼女は一切の疑問や恐怖、そして雑念を抱かず、常に全力で身を尽くしてきた。\n眞と影の時代において、影は自分と同じような責任を負い、惨憺たる喪失を味わったと彼女は聞いた。\n二つの影が重なったとき、「彼女」の永遠の意志であったはずのものに、無数の亀裂が見えた。運命は輪廻するもの。彼女は約束通り、宣戦布告しなければならない。\n\n<i>「この身は、無上なる威厳を象徴し、一国を統べる権限を与えられ、『雷電将軍』の一切を凝集したもの」</i>\n<i>「当然のことながら、影が前進する中、絶え間なく失われていく苦しみと、永遠を目指す決心も受け継いでいます」</i>\n<i>「決心、勇猛、愛慕、憎悪…そのすべてが時間という長い川の中で歪み、変わっていくのです」</i>\n<i>「『規則』のみが、永遠を保つことができる」</i>",
