    "90800": {
        "_id": 90800,
        "Name": "起源オアシスの守護者",
        "Title": [
            "「火種」によって蘇った生命"
        ],
        "Desc": "アペプはかつて数多の子孫と共に、芳しい海にある百尺の巨木と千里と続く蔓草の中で棲んでいた——その姿はまるで水を得た魚のようであった。やがて草木が枯れて塵となると、無数の砂粒のように小さな生き物が、その土地に脆い城と国を築いた。\nアペプはかつて数多の子孫と共に、砂海を熱き湯のように沸き返らせ、城を落ち葉のように吹き散らした。やがて新たな砂海の王と故郷を失った王は和解し、陽の光に照らされる砂丘はすべて人と神に属すこととなった。そして、龍のオアシスはその心の中に残った。\nアペプはかつて数多の子孫と共に進化の知識を共有した。なぜなら、流水が腐ることはないが、朽ちた木は必ず倒れるからである。そして最後、砂の王との約束を果たして究極の知恵を手に入れた。それ以降、その目には終末の景色、果てしない世界の滅亡しか映せない。\nアペプはかつて独りで世界の滅亡の景色に溺れていた。すべての人、神、龍、獣、鳥、魚と——それからすべての記憶、知恵、言葉、怨嗟は色のない塵となって、最後の月光は白炎の雨となり荒土に落ちる。\n……\nアペプはかつて砂海の底を行宮ではなく、そこを自身の墓だと考えていた。「知恵」の毒は、すぐさまアペプを幾星霜の怨嗟と怒りから解放させた。アペプは既に、終末の色を欠いた景色に退屈を感じていた。やがて、もっとも若い神と金色の旅人によってアペプは思い出すことになる。自分が過去に支配していた青々とした土地が金メッキの荒原となり、自分の子孫がそこで生きるために醜く姿を歪めていようとも、その心の中にはかつてのオアシスの景色がずっと大切に残っていることを。",
        "Color": "Grass",
        "HP": 8.0,
        "HPCurve": 2,
        "ATK": 10.0,
        "ATKCurve": 4,
        "RESBase": {
            "Grass": 0.7
        },
        "Icon": [
            "ap"
        ],
        "MultiPlayerID": 103,
        "Csx": [
            "ECEnemiesOfNote/起源绿洲的守望者"
        ]
    },
