        "Desc": "熱を吸収し続けなければ活動状態を維持できない特異な魔物。\nかつて、ナタの大地には古く幽邃なる火がさまざまな形で燃え広がっていた。その時代、この地に古くから住んでいた偉大な者たちはこれらの火を使って光、熱、そして知恵を伝えていた。彼らは生命と魂もまた、火打石を打ち合わせたときに飛び散る火花から初めて形を得ると信じていた。\nもし永遠に燃え続ける芯を持つならば、頑固な石でさえも生命を生み出すことができるだろう。溶岩の像に包まれた燃えさしは、その偉大な時代の、冷えた灰のような残滓であるという。",
