        "Desc": "月光の残輝の中を巡行する高慢な生き物——今は高天の主によって飼い慣らされた古の力を使役している。\n伝説によれば、これらの優雅な霊獣は霜月がまだ流転していた時代に生まれ、また神の使いの偏愛により天光に染まることがなかったのだという。今日に至っても、霜月の追随者たちの間でさえ、これらの霊獣はこの世に存在しない聖獣として見なされており、月光の秘密の径を通って世界の外に姿を隠したと言われている。しかし、過去数百年と同じように、彼らは今なお月影の中を歩み、二つの世界の境界を巡りながら、災厄に狙われたこの地とそこに住む人々を守り続けている——それは、彼らがかつて黄金の街の聖徒に立てた誓いなのである。",
