        "Desc": "暗黒の裂け目を抜けて、異界から侵入してきたアビスの魔物。\n古代の賢者たちは人類を「羽のない二足歩行の獣」と定義し、人類と他の獣を区別することで、人類の優位性を証明しようとした。星海をさまよいながら、鉤状のくちばしを釣り糸のように垂らして他世界の命を貪る不死の存在…羽ではなくウロコを纏ったこの無名の釣り人たちもまた、ある意味では「人類」の定義に当てはまるのかもしれない。",
