            "D": "「アビス教団」の魔物であり、暗き烈焔の熱を囁く者。\n一部攻撃がキャラクターにダメージを与えると、アビスの炎の烙印が押されます。烙印は短時間経過すると爆発し、チーム全員に<color=#FFE14BFF>大ダメージを与えます</color>。シールドを利用することで、烙印を防げる場合があります。烙印が爆発すれば、フィールド上のキャラクターは戦闘不能になってしまうかもしれません。\nアビスの詠唱者·淵炎が「淵炎の加護」状態になった時、<color=#FFE14BFF>黯炎炉心を破壊することで、「淵炎の加護」状態を素早く解除することができます</color>。"
