    "3017": [
        {
            "I": [
                "UI_Tutorial_138"
            ],
            "D": "エネルギーを吸収し、攻撃をカウンターできる遺跡機械。遺跡ドレイク·飛空は定期的に危険なエネルギーの奔流を放ち、直前に受けたダメージの主な元素タイプに応じて、元素耐性をアップさせます。一部状態では、全身のあちこちにある<color=#FFE14BFF>コア</color>が露わになります。このチャンスを掴んでコアを攻撃すれば、ダウンさせることができ、元素耐性アップを阻止できるかもしれません…"
        }
    ],
    "3016": [
        {
            "I": [
                "UI_Tutorial_137"
            ],
            "D": "エネルギーを吸収し、攻撃をカウンターできる遺跡機械。遺跡ドレイク·陸行は定期的に危険なエネルギーの奔流を放ち、直前に受けたダメージの主な元素タイプに応じて、元素耐性をアップさせます。エネルギーの奔流を発動しようと力を溜めている時、または特定のダッシュ攻撃時に頭部の<color=#FFE14BFF>コア</color>が露出します。この機会を狙ってコアを攻撃すれば、ダウンさせ、元素耐性アップを阻止できるかもしれません…"
        }
    ],
    "3022": [
        {
            "I": [
                "UI_Tutorial_143"
            ],
            "D": "エネルギーを吸収し、攻撃をカウンターできる遺跡機械。遺跡ドレイクより高性能であり、地上および飛空状態で攻撃ができます。兆載永劫ドレイクは定期的に危険なエネルギーの奔流を放ち、直前に受けたダメージの主な元素タイプに応じて、元素耐性をアップさせます。一部状態では、全身の至る所にある<color=#FFE14BFF>コア</color>が露わになります。このタイミングでコアを攻撃すれば、ダウンさせることができ、<color=#FFE14BFF>アップしている元素耐性を除去できます</color>。ダウン状態から回復した後、飛空または地上状態に切り替わります。"
        }
    ],
    "3023": [
        {
            "I": [
                "UI_Tutorial_144"
            ],
            "D": "砂漠より訪れた古代機械、遺跡機械とは大きく異なります。戦闘時、プライマル構造体はユニットを発射し、コアが「インビジブル」状態になり、透明かつダメージ耐性が上がります。<color=#FFE14BFF>激化反応でコアに影響を与えたり、ユニットが破壊された後の回復中に雷元素攻撃を繰り出したり</color>することで、プライマル構造体のインビジブル状態を解除できます。その後、過剰オーバークロック状態となりダウンします。"
        }
    ],
