    "3043": [
        {
            "I": [
                "UI_Tutorial_Nutcracker_Drop"
            ],
            "D": "フォンテーヌ科学院のマイヤルデが提供し、クロックワーク·マシナリーの「コッペリア」と「コペリウス」によって披露される華やかな公演。挑戦前に<color=#FFE14BFF>マイヤルデと会話</color>して、挑戦する演目を選ぶ必要があります。挑戦をクリアした後に<color=#FFE14BFF>地脈の花</color>が生み出す報酬は、挑戦する演目に関係しています。"
        },
        {
            "I": [
                "UI_Tutorial_193a"
            ],
            "D": "「コッペリアの葬送」：主役はクロックワーク·マシナリーの女性「コッペリア」。公演のクライマックスで、コッペリアは舞台の中央に留まり、<color=#FFE14BFF>ウーシア</color>のエネルギー特徴を持つ奇械クロックワークを露わにし、出力効率を大幅に向上させて無数の葬送の旋風を巻き起こします。"
        },
        {
            "I": [
                "UI_Tutorial_193b"
            ],
            "D": "「コペリウスの劫罰」：主役はクロックワーク·マシナリーの貴族「コペリウス」。公演のクライマックスで、コペリウスは舞台の中央に留まり、<color=#FFE14BFF>プネウマ</color>のエネルギー特徴を持つ奇械クロックワークを露わにし、出力効率を大幅に向上させて自身にバリアを付与し、劫罰の霜の心を3個生成します。"
        }
    ],
    "3067": [
        {
            "I": [
                "UI_Tutorial_202"
            ],
            "D": "フォンテーヌ運動エネルギー工学科学研究院の制御不能な大型装置。戦闘中、ウーシアのエネルギー特徴を発生させ、重力軽減フィールドを展開します。フィールド内では、キャラクターのジャンプ力が大幅にアップされます。この状態にある時、<color=#FFE14BFF>プネウマの攻撃</color>によってコアで対消滅が発生すると、重力軽減フィールドは停止します。"
        }
    ],
