            "D": "砂漠より訪れし、まとまりのない傭兵集団のソードダンサー。一定のダメージを受けると、武器に宿る不吉な悪霊が解き放たれ、<color=#FFE14BFF>魔化状態</color>に入り、戦闘力が大幅にアップします。魔化状態が終了すると、一定時間の衰弱状態になります。"
