            "D": "がたいのいい成年のヴィシャップ·岩。一部の攻撃が<color=#FFE14BFF>シールド</color>に守られているキャラクターに命中し、かつシールドを破壊できなかった時、反動で一時的に気絶してしまうらしい…"
