    "3070": [
        {
            "I": [
                "UI_Tutorial_206"
            ],
            "D": "山奥に生息する仙獣。<color=#FFE14BFF>水元素</color>と<color=#FFE14BFF>風元素</color>を同時に使用して戦う。<color=#FFE14BFF>水元素</color>の仙力を集めている間に凍結させ、さらに<color=#FFE14BFF>氷砕きあるいは溶解などの元素反応</color>によって堅氷を砕くと、一時的に相手を行動不能状態にさせられます。<color=#FFE14BFF>風元素</color>の仙力を集めている間は、<color=#FFE14BFF>風元素と反応する元素タイプの攻撃</color>によって召喚された霊風の珠を破壊でき、この場合もまた一時的に相手を行動不能状態にさせられます。"
        }
    ],
    "3071": [
        {
            "I": [
                "UI_Tutorial_205"
            ],
            "D": "沈玉の谷の山林に生息する獰猛な野獣。元素反応で凍結させ、その後、<color=#FFE14BFF>氷砕きまたは溶解などの元素反応</color>で堅氷を砕くと、一時的に相手を行動不能状態にさせられます。"
        }
    ],
    "3079": [
        {
            "I": [
                "UI_Tutorial_214"
            ],
            "D": "ナタの各地を徘徊しているが、その目的は謎に包まれている古い機械。キャラクターが「夜魂の加護」状態に入る、またはその状態を維持しているとき、秘源機兵·ハンターシーカーは「応戦対策」を蓄積します。「応戦対策」がMAXになると、秘源機兵·ハンターシーカーは特殊な集束ビームを放ちます。しかし、ピンチはチャンスでもあります——その隙に大ダメージを与えられるかもしれません。"
        }
    ],
    "3081": [
        {
            "I": [
                "UI_Tutorial_216"
            ],
            "D": "壮絶な戦いを数えきれないほど経験してきたユムカ竜。亜種ではなく、ただ食欲に駆られた結果、今の姿になったようです。戦闘時にはフレイムグレネードの実を集めて吐き出し、爆弾として利用してきます。山の王·貪食のユムカ竜が吞み込む前に、<color=#FFE14BFF>炎元素でフレイムグレネードの実を爆発させたら</color>、果たしてどうなるのか…"
        }
    ],
    "3080": [
        {
            "I": [
                "UI_Tutorial_215"
            ],
            "D": "自身にも手に負えないほどの強大な力に耐えられず、超然とした姿を持つようになったクク竜亜種。戦闘時には空高く飛び上がり、力を集結させた「金焔」形態となって自身にバリアを張り、熱風を呼び起こす「灼風の羽根」を地上に向けて放ちます。クク竜亜種は「灼風の羽根」に向かって急降下してきます。それまでに「灼風の羽根」を破壊できなかった場合、クク竜亜種は燃素の風域を利用して空中へと再び戻ります。この行動を力尽きて元の姿に戻るまで繰り返します。急降下してくる前に<color=#FFE14BFF>炎元素と反応できる元素で「灼風の羽根」を破壊</color>することが、倒すカギになりそうです。"
        }
    ],
    "3075": [
        {
            "I": [
                "UI_Tutorial_212"
            ],
            "D": "ナタの各部族が信仰する「大霊」は、黒曜石のトーテムの姿を借りて顕現します。戦闘中、大霊の化身は「領域·試練の刻」を一定時間展開し、自身にシールドを付与して、領域内にいるチーム内キャラクターの元素エネルギーを吸収し続けます。そして、領域内のキャラクターは与えるダメージが大幅にアップします。<color=#FFE14BFF>領域が終了する前にシールドを破壊</color>すると、大量の元素エネルギーが返還されます。シールドを破壊できなかった場合、大霊の化身は残りのシールド耐久値を基に元素バリアを生成します。"
        }
    ],
