    "3078": [
        {
            "I": [
                "UI_Tutorial_213"
            ],
            "D": "熱を吸収し続けなければ活動状態を維持できない不思議な魔物。しかし、熱を吸収しすぎると、自身もダメージを受けてしまうようです。<color=#FFE14BFF>炎元素攻撃</color>で過燃焼状態に入らせると、すぐさま溶けて崩れます。"
        }
    ],
    "3083": [
        {
            "I": [
                "UI_Tutorial_219"
            ],
            "D": "深遠の暗く歪んだ異界からこの世に降臨した、様々なモノに擬態できるアビスの魔物。戦闘中、深遠なるミミックフローラは自身に虚界力バリアを付与します。深遠なるミミックフローラの一部の攻撃は、重ね掛け可能な「蝕破」状態を付与し、一定時間後、チーム内にいる自身のフィールド上キャラクターのHPを減らします。<color=#FFE14BFF>元素攻撃を一定回数</color>与えるとバリアを破壊できます。また、<color=#FFE14BFF>夜魂性質の元素攻撃</color>はより効率的に敵の防御を破れます。"
        }
    ],
    "3082": [
        {
            "I": [
                "UI_Tutorial_218"
            ],
            "D": "強力な破壊力を持つ機械。キャラクターが「夜魂の加護」状態に入る、または維持中、秘源機兵・機巧デバイスは「応戦対策」の進捗度を蓄積します。進捗度がMAXになると、「球状雷砲」の準備に入ります。準備期間中、秘源機兵・機巧デバイスは「吸収機械」を起動し、固体燃素を掘り出して燃素を吸収します。「吸収機械」は重力場を生成するため、「吸収機械」を破壊して「球状雷砲」のチャージを中断するには、<color=#FFE14BFF>固体燃素を登って重力場に入らなければなりません</color>。"
        }
    ],
    "3086": [
        {
            "I": [
                "UI_Tutorial_222"
            ],
            "D": "深邃暗晦の歪んだ異界から訪れ、大地の記憶を侵蝕する漆黒の魔獣。自身の姿を捻じ曲げ、強大な敵に変化できます。一部の攻撃は重ね掛け可能な「蝕破」状態を付与し、一定時間後、チーム内にいる自身のフィールド上キャラクターのHPを減らします。戦闘中、深遠なるミミックパピラは「暗闇の祝祷」を行い、自身に虚界力バリアを付与します。この時に<color=#FFE14BFF>元素攻撃を一定回数</color>与えてバリアを破壊すると、深遠なるミミックパピラは短時間の混乱状態に入ります。<color=#FFE14BFF>夜魂性質の元素攻撃</color>はより効率よくその守りを崩せます。"
        }
    ],
